#include<iostream>
#include<string>
int main() {
	std::string s;
	std::cin >> s;
	int black=0, white=0;
	for (int i = 0; i < s.size(); i++) {
		if (s[i] == 'B') {
			black++;
		}
		if (s[i] == 'W') {
			white++;
		}
	}
	if (black > white) {
		std::cout << "Black wins";
	}
	if (black < white) {
		std::cout << "White wins";
	}
	if (black == white) {
		std::cout << "Draw";
	}
}
